import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function CreateClub({ userId }) {
  const [formData, setFormData] = useState({
    name: '',
    town: '',
    telephone: '',
    hourly_price: '',
    description: '',
    address: '',
    website: '',
    social_media: ''
  });
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    // Redirect to login if not logged in
    if (!userId) {
      navigate('/login');
    }
  }, [userId, navigate]);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);
    setLoading(true);
    
    // Validate hourly_price is a number
    const hourlyPrice = parseFloat(formData.hourly_price);
    if (isNaN(hourlyPrice)) {
      setError('Hourly price must be a valid number');
      setLoading(false);
      return;
    }
    
    const clubData = {
      ...formData,
      hourly_price: hourlyPrice
    };
    
    try {
      // Get token from localStorage
      const token = localStorage.getItem('token');
      
      if (!token) {
        setError('Authentication error. Please log in again.');
        navigate('/login');
        return;
      }
      
      const response = await fetch('/api/v1/clubs/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
        body: JSON.stringify(clubData),
        credentials: 'include' // Include cookies with the request
      });
      
      if (response.ok) {
        const club = await response.json();
        localStorage.setItem('clubId', club.id);
        alert('Club created successfully!');
        navigate('/dashboard');
      } else {
        const errorData = await response.json();
        setError(typeof errorData.detail === 'string' 
          ? errorData.detail 
          : JSON.stringify(errorData.detail));
      }
    } catch (err) {
      setError('An error occurred. Please try again.');
      console.error('Error creating club:', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="card">
      <h2>Create Your Club</h2>
      {error && <div className="error-message">{error}</div>}
      
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="name">Club Name</label>
          <input 
            type="text" 
            id="name" 
            name="name" 
            value={formData.name}
            onChange={handleChange}
            required 
            disabled={loading}
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="town">Town</label>
          <input 
            type="text" 
            id="town" 
            name="town" 
            value={formData.town}
            onChange={handleChange}
            required 
            disabled={loading}
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="telephone">Telephone Number</label>
          <input 
            type="tel" 
            id="telephone" 
            name="telephone" 
            value={formData.telephone}
            onChange={handleChange}
            required 
            disabled={loading}
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="hourly_price">Hourly Price</label>
          <input 
            type="number" 
            id="hourly_price" 
            name="hourly_price" 
            min="0" 
            step="0.01"
            value={formData.hourly_price}
            onChange={handleChange}
            required 
            disabled={loading}
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="description">Description</label>
          <textarea 
            id="description" 
            name="description" 
            rows="5"
            value={formData.description}
            onChange={handleChange}
            placeholder="Describe your club"
            disabled={loading}
          ></textarea>
        </div>
        
        <div className="form-group">
          <label htmlFor="address">Address</label>
          <input 
            type="text" 
            id="address" 
            name="address" 
            value={formData.address}
            onChange={handleChange}
            placeholder="Street address"
            disabled={loading}
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="website">Website</label>
          <input 
            type="url" 
            id="website" 
            name="website" 
            value={formData.website}
            onChange={handleChange}
            placeholder="https://example.com"
            disabled={loading}
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="social_media">Social Media</label>
          <input 
            type="text" 
            id="social_media" 
            name="social_media" 
            value={formData.social_media}
            onChange={handleChange}
            placeholder="@your_handle"
            disabled={loading}
          />
        </div>
        
        <button type="submit" disabled={loading}>
          {loading ? 'Creating...' : 'Create Club'}
        </button>
      </form>
    </div>
  );
}

export default CreateClub;
